import './App.scss';
import Comp2 from './Component/Comp2';
import Comp1 from './Component/Comp1';
import {
  BrowserRouter,
  Routes,
  Route
} from "react-router-dom";

function App() {
  return (
    <BrowserRouter>
      <div>
        <Routes>

          <Route>
            <Comp1/>
          </Route>

          <Route>
            <Comp2/>
          </Route>

        </Routes>
      </div>
    </BrowserRouter>
  );
}

export default App;
